const Circlewrap = styled.div`
    width: 275px;
    display: flex;
    margin: 0 10px;
`;

const Click = styled.div`
    display: flex;
    width: 20px;
    height: 20px;
    margin: 15px 8px;
    border: 5px solid seagreen;
    border-radius: 50%;
    background-color: white;
`;

export default Circle;
